def statistics(detected):
    # 对检测到的目标进行统计
    # 分区间进行统计 统计10以下 10-50 50-100 100-1000 1000m以上的数量
    # 转换为km单位
    sum1 = 0
    sum2 = 0
    sum3 = 0
    sum4 = 0
    sum5 = 0
    #保存各个区间的统计数量
    for i in detected:
        if i <= 0.03:
            sum1 += 1
        elif i > 0.03 and i <= 0.1:
            sum2 += 1
        elif i > 0.1 and i <= 0.3:
            sum3 += 1
        elif i > 0.3 and i <= 1:
            sum4 += 1
        else:
            sum5 += 1
    res = [sum1,sum2,sum3,sum4,sum5]
    return res

